#OKDESAYUNO 

Juan José González, de 
@paradores: "Nosotros tenemos una capilaridad en el país enorme. Estamos en sitios que 'pertenecen' a la España vaciada. En nuestro entorno pequeño somos generadores de economía y nos sentimos orgullosos de ello" https://t.co/mI8tN1sWc8

