#OKDESAYUNO 

Almudena Maillo, concejal-delegada de Turismo de 
@MADRID: "Lo primero que hicimos es estar al lado del sector más castigado que era el de la movilidad. Les quitamos la presión económica haciendo bonificaciones" https://t.co/mI8tN1sWc8
